import React from "react";
import { useState } from "react";
import { Modal, Button } from "react-bootstrap";
import "./Rake_Form.css";



function RakeForm (){
    const cellStyle1 = {
        border: "0.3px solid white",
        padding: "8px",
        background: "#0eacb3",
        color: "white",
        fontSize: "12px",
        fontWeight: "400",
        width: "300px",
      };
      
}

export default RakeForm;
